css:
/*Fonte*/
body{
  font-family:'Georama';
}

/*Diminuir_Barra_Marketing*/
@media (min-width: 992px)
.top-bar__countdown {
    font-size: 0.8em!important;
    padding-top: 5px!important;
    padding-bottom: 5px!important;
}

/*Diminuir_font_barra-pages-topo*/
.top-bar__page-links a {
    font-weight: 500;
    font-size: 0.8em;
}

/*Alinhar_texto_barra-pages-topo*/
.top-bar__nav {
    text-align: end;
}

/*cor_infobar*/
.info-bar {
    width: 80%;
    max-width: 60rem;
    margin-left: auto;
    margin-right: auto;
    background: #ffffff00;
    color: #0b6666;
}

/*Tamanho_font_infobar*/
@media (min-width: 576px)
.info-bar__item {
    text-transform: uppercase;
    font-weight: 500;
    font-size: 0.8em;
}
